-- ----------------------------
-- View structure for `activity_leaderboards`
-- ----------------------------
DROP VIEW IF EXISTS `activity_leaderboards`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `activity_leaderboards` AS select count(0) AS `count`,`log`.`player_id_owner` AS `player_id_owner`,`log`.`player_id` AS `player_id`,`player`.`name` AS `player_name` from (`log` join `player` on((`player`.`id` = `log`.`player_id`))) where (`log`.`accepted` is not null) group by `log`.`player_id`,`log`.`player_id_owner` order by count(0) desc;

-- ----------------------------
-- View structure for `activity_leaderboards_last_month`
-- ----------------------------
DROP VIEW IF EXISTS `activity_leaderboards_last_month`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `activity_leaderboards_last_month` AS select count(`log`.`id`) AS `count`,`log`.`player_id_owner` AS `player_id_owner`,`player`.`id` AS `player_id`,`player`.`name` AS `player_name` from (`player` left join `log` on(((`player`.`id` = `log`.`player_id`) and (`log`.`acquired` >= (curdate() - interval ((dayofmonth(curdate()) + dayofmonth(last_day(curdate()))) - 1) day)) and (`log`.`acquired` < (curdate() - interval (dayofmonth(curdate()) - 1) day)) and (`log`.`accepted` is not null)))) group by `player`.`id`,`log`.`player_id_owner` order by count(`log`.`id`) desc;

-- ----------------------------
-- View structure for `activity_leaderboards_last_week`
-- ----------------------------
DROP VIEW IF EXISTS `activity_leaderboards_last_week`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `activity_leaderboards_last_week` AS select count(`log`.`id`) AS `count`,`log`.`player_id_owner` AS `player_id_owner`,`player`.`id` AS `player_id`,`player`.`name` AS `player_name` from (`player` left join `log` on(((`player`.`id` = `log`.`player_id`) and (`log`.`acquired` >= (curdate() - interval (dayofweek(curdate()) + 6) day)) and (`log`.`acquired` < (curdate() - interval (dayofweek(curdate()) - 1) day)) and (`log`.`accepted` is not null)))) group by `player`.`id`,`log`.`player_id_owner` order by count(`log`.`id`) desc;

-- ----------------------------
-- View structure for `activity_leaderboards_this_month`
-- ----------------------------
DROP VIEW IF EXISTS `activity_leaderboards_this_month`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `activity_leaderboards_this_month` AS select count(`log`.`id`) AS `count`,`log`.`player_id_owner` AS `player_id_owner`,`player`.`id` AS `player_id`,`player`.`name` AS `player_name` from (`player` left join `log` on(((`player`.`id` = `log`.`player_id`) and (`log`.`acquired` >= (curdate() - interval (dayofmonth(curdate()) - 1) day)) and (`log`.`acquired` <= curdate()) and (`log`.`accepted` is not null)))) group by `player`.`id`,`log`.`player_id_owner` order by count(`log`.`id`) desc;

-- ----------------------------
-- View structure for `activity_leaderboards_this_week`
-- ----------------------------
DROP VIEW IF EXISTS `activity_leaderboards_this_week`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `activity_leaderboards_this_week` AS select count(`log`.`id`) AS `count`,`log`.`player_id_owner` AS `player_id_owner`,`player`.`id` AS `player_id`,`player`.`name` AS `player_name` from (`player` left join `log` on(((`player`.`id` = `log`.`player_id`) and (`log`.`acquired` >= (curdate() - interval (dayofweek(curdate()) - 1) day)) and (`log`.`acquired` <= curdate()) and (`log`.`accepted` is not null)))) group by `player`.`id`,`log`.`player_id_owner` order by count(`log`.`id`) desc;

-- ----------------------------
-- View structure for `activity_ranking`
-- ----------------------------
DROP VIEW IF EXISTS `activity_ranking`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `activity_ranking` AS select count(0) AS `count`,`log`.`player_id` AS `player_id`,`player`.`name` AS `player_name` from (`log` join `player` on((`player`.`id` = `log`.`player_id`))) group by `log`.`player_id` order by count(0) desc;

-- ----------------------------
-- View structure for `badge_activity_progress`
-- ----------------------------
DROP VIEW IF EXISTS `badge_activity_progress`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `badge_activity_progress` AS select `player`.`id` AS `player_id`,`badge`.`id` AS `badge_id`,`ar`.`activity_id` AS `activity_id`,coalesce(sum(`ars`.`times`),0) AS `activities_completed`,coalesce(`ar`.`count`,0) AS `activities_required` from (((`player` join `badge`) left join `activity_requisite` `ar` on((`ar`.`badge_id` = `badge`.`id`))) left join `activity_requisite_summary` `ars` on(((`ar`.`id` = `ars`.`activity_requisite_id`) and (`ars`.`player_id` = `player`.`id`)))) group by `player`.`id`,`badge`.`id`,`ar`.`activity_id` order by `player`.`id`,`badge`.`id`,`ar`.`activity_id`;

-- ----------------------------
-- View structure for `badge_claimed`
-- ----------------------------
DROP VIEW IF EXISTS `badge_claimed`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `badge_claimed` AS select `player`.`id` AS `player_id`,`badge`.`id` AS `badge_id`,(`badge_log`.`id` is not null) AS `claimed` from ((`player` join `badge`) left join `badge_log` on(((`badge_log`.`player_id` = `player`.`id`) and (`badge_log`.`badge_id` = `badge`.`id`))));

-- ----------------------------
-- View structure for `calendar_log`
-- ----------------------------
DROP VIEW IF EXISTS `calendar_log`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `calendar_log` AS select count(0) AS `coins`,`log`.`player_id` AS `player_id`,`log`.`acquired` AS `acquired`,`log`.`domain_id` AS `domain_id`,`log`.`activity_id` AS `activity_id` from `log` group by `log`.`activity_id`,`log`.`player_id`,`log`.`acquired` order by `log`.`acquired`,`log`.`player_id`;

-- ----------------------------
-- View structure for `different_activities_completed`
-- ----------------------------
DROP VIEW IF EXISTS `different_activities_completed`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `different_activities_completed` AS select count(distinct `log`.`activity_id`) AS `different_activities_completed`,`log`.`domain_id` AS `domain_id`,`domain`.`name` AS `domain_name`,`log`.`player_id` AS `player_id`,`player`.`name` AS `player_name`,`log`.`player_id_owner` AS `player_id_owner` from (((`log` join `player` on((`player`.`id` = `log`.`player_id`))) join `activity` on((`activity`.`id` = `log`.`activity_id`))) join `domain` on((`domain`.`id` = `activity`.`domain_id`))) where ((`log`.`reviewed` is not null) and (`activity`.`inactive` = 0)) group by `log`.`player_id`,`log`.`domain_id` order by `log`.`player_id`,`log`.`domain_id`;

-- ----------------------------
-- View structure for `domain_activities_count`
-- ----------------------------
DROP VIEW IF EXISTS `domain_activities_count`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `domain_activities_count` AS select `activity`.`domain_id` AS `domain_id`,`activity`.`player_id_owner` AS `player_id_owner`,count(0) AS `count` from `activity` where (`activity`.`inactive` = 0) group by `activity`.`domain_id`,`activity`.`player_id_owner` order by `activity`.`domain_id`;

-- ----------------------------
-- View structure for `event_activity_progress`
-- ----------------------------
DROP VIEW IF EXISTS `event_activity_progress`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `event_activity_progress` AS select `log`.`player_id` AS `player_id`,`log`.`event_id` AS `event_id`,`log`.`activity_id` AS `activity_id`,count(0) AS `times_obtained`,`event_activity`.`count` AS `times_required`,floor(((count(0) / `event_activity`.`count`) * 100)) AS `progress` from (`log` left join `event_activity` on(((`event_activity`.`event_id` = `log`.`event_id`) and (`event_activity`.`activity_id` = `log`.`activity_id`)))) where ((`log`.`reviewed` is not null) and (`log`.`event_id` is not null)) group by `log`.`player_id`,`log`.`event_id`,`log`.`activity_id`;

-- ----------------------------
-- View structure for `last_week_logs`
-- ----------------------------
DROP VIEW IF EXISTS `last_week_logs`;
CREATE ALGORITHM=UNDEFINED DEFINER=`adminnEmhFH2`@`%` SQL SECURITY DEFINER VIEW `last_week_logs` AS select `activity`.`id` AS `activity_id`,concat((select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 1 day)))),',',(select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 2 day)))),',',(select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 3 day)))),',',(select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 4 day)))),',',(select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 5 day)))),',',(select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 6 day)))),',',(select count(0) from `log` where ((`log`.`activity_id` = `activity`.`id`) and (`log`.`acquired` = (curdate() - interval 7 day))))) AS `logs` from `activity` where (`activity`.`inactive` = 0) order by `activity`.`id`;

